<body>
<h1>粵拼字表</h1>
<p>唔識粵拼？想揾粵拼相對應嘅字？呢個表幫到你！</p>
<script>

// Reduce the frequency of non-CJK objects to avoid weird situations.
for (obj in FREQLIST) {
    var o = obj.charCodeAt(0);
    if (!((0x3400 <=  o && o  <= 0x4DBF) || (0x4E00 <=  o && o  <= 0x9FFF) || (0xF900 <=  o && o  <= 0xFAFF) || (0x20000 <=  o && o  <= 0x2FFFF))) {
        if (obj.length == 1) { // quick workaround for chars outside BMP
            FREQLIST[obj] -= 999999999;
            console.log(obj);
        }
    }
}

function cmp(a, b) {
    return (FREQLIST[b] || 0) - (FREQLIST[a] || 0);
}

var jyutpings = {};

for (var obj in CHARLIST) {
    var jps = CHARLIST[obj];
    // console.log(jps);

    // Count the total number of pronunciations (so that we know whether a pronunciation is "typical" or not (i.e. probably wrong)
    var total = 0;
    for (var jp in jps) {
        total = total + jps[jp];
    }

    for (var jp in jps) {
        var rate = jps[jp] * 1.0 / total;
        if (rate > 0.2) {
            jyutpings[jp] = jyutpings[jp] || [];
            if (jps[jp] * 1.0 / total < 0.49) {
                jyutpings[jp].push(obj + "*");
            } else {
                jyutpings[jp].push(obj);
            }
        }
    }
}

var jp_notones = {};
for (var jp in jyutpings) {
    var lst = jyutpings[jp];
    lst.sort(cmp);

    jp_notones[jp.replace(/[1-6]/, "")] = 1;
}

var jp_notones_list = [];
for (var jp in jp_notones) {
    jp_notones_list.push(jp);
}
jp_notones_list.sort();

// console.log(jp_notones);
</script>


<table>
<script>

for (var i = 0; i < jp_notones_list.length; i++) {
    var jpnt = jp_notones_list[i];
    document.write("<tr>");
    for (var t = 1; t <= 6; t++) {
        document.write('<td><span class="jptitle">' + jpnt + "" + t + "</span><br>");
        if (jyutpings[jpnt + t]) {
            document.write('<span class="jpcontent">' + jyutpings[jpnt+t][0] + '</span>');
        } else {
            document.write('<span class="jpna">N/A</span>');
        }
        document.write("</td>");
    }

    document.write("</tr>");
}

</script>
</table>
